Parses.Sparql:
#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT  ?x
WHERE {
  ?x ns:location.country.official_language ns:m.04306rv	. # German language
}

#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x
WHERE {
    ns:m.03d9rk ns:people.person.places_lived ?y .  # ann frank
    ?y ns:people.place_lived.location ?x ;
       ns:people.place_lived.start_date ?start_date .
    ns:m.081pw ns:time.event.start_date ?war_start_date .
    FILTER (xsd:datetime(?start_date) - xsd:datetime(?war_start_date) < 0)
}

#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x 
WHERE {
	FILTER (?x != ns:m.03shp)
	{ 
	  ns:m.03shp ns:location.statistical_region.places_exported_to ?y .
	  ?y ns:location.imports_and_exports.exported_to ?x . 
	}
	UNION
	{
	  ns:m.03shp ns:location.statistical_region.places_imported_from ?y .
	  ?y ns:location.imports_and_exports.imported_from ?x . 
	}
}

